import styled from 'styled-components';

export const Container = styled.div`
  background: #c4c4c4;
  height: 800px;
  width: 100vw;
  /* -moz-transform: scale(2) rotate(-10deg) translateX(0px) translateY(0px)
    skewX(-10deg) skewY(0deg);
  -webkit-transform: scale(2) rotate(-10deg) translateX(0px) translateY(0px)
    skewX(-10deg) skewY(0deg);
  -o-transform: scale(2) rotate(-10deg) translateX(0px) translateY(0px)
    skewX(-10deg) skewY(0deg);
  -ms-transform: scale(2) rotate(-10deg) translateX(0px) translateY(0px)
    skewX(-10deg) skewY(0deg); */
  transform: scale(1) rotate(-5deg) translateX(0px) translateY(100px)
    skewX(-5deg) skewY(0deg);
`;
